import React from "react";

function Cards(props) {
  console.log(props, "props");
  return props.forEach((element) => {
    <>
      <div className="cards">
        <div className="card">
          <img src={element.imgSrc} alt="" />
          <div className="card_info">
            <span className="card_category">{element.cardCategory}</span>
            <h3 className="card_title">{element.seriesname}</h3>
            <a href={element.hrefLink} target="_blank" rel="noreferrer">
              <button>Watch Now</button>
            </a>
          </div>
        </div>
      </div>
    </>;
  });
}
export default Cards;
